export default async function userFetch() {
    const URL = `https://fortnite-api.com/v2/stats/br/v2`;


    try {
        const response = await fetch(URL, { headers: {Authorization: 'a7a2bdfd-d685-4ee6-9da7-456a52f218f8'}})

        const data = await response.json();
        console.log(data)
        return data;

    } catch (error) {
        return Error(error)
    }


}
